syntax = "proto2";

package video_streaming;

import "video_streaming/format_id.proto";
import "video_streaming/selectable_video_format.proto";
import "video_streaming/selectable_audio_format.proto";

option java_package = "com.google.android.apps.youtube.proto.streaming";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTVS";

message SelectableFormats {
	repeated FormatId unnamed_field_1 = 1;
	repeated FormatId unnamed_field_2 = 2;
	optional string unnamed_field_3 = 3;
	repeated SelectableVideoFormat unnamed_field_4 = 4;
	repeated SelectableAudioFormat unnamed_field_5 = 5;
}
